import React, { useState, useEffect } from 'react';
import { View, Image, ImageBackground, Text } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';

import styles from './estilo';
import styleGeral from '../../estiloGeral/style'

export default function tCadastrarInfoC() {

    const [nome, setnome] = useState("");
    const [data_de_nasc, set_data_de_nasc] = useState("");
    const [sexo, setsexo] = useState("");
    const [cpf, setcpf] = useState("");
    const [celular, setcelular] = useState("");
    const [email, setemail] = useState("");
    const [senha, setsenha] = useState("");
    const [preco, setpreco] = useState("");
    const [link, setlink] = useState("");

    const [dia, setdia] = useState("");
    const [mes, setmes] = useState("");
    const [ano, setano] = useState("");



    async function data() {
        let url = `https://viacep.com.br/ws/${cep}/json/`;

        let req = await fetch(url);
        let res = await req.json();

        setLogradouro(res.logradouro);
        setLocalidade(res.localidade);
        setUf(res.uf);
    }

    const navigation = useNavigation();

    function Voltar() {
        navigation.goBack()
    }

    return (
        <ImageBackground style={styleGeral.container}>
            <View style={styles.marginTop}>
                <Image style={{ width: 100, height: 109, marginTop: -30 }}
                    source={require('../../../assets/logo.png')} />
            </View>

            <View>
                <Text style={styles.title}>Cadastro Cuidador</Text>
            </View>

            <ScrollView>
                <View style={styles.footer}>
                    <TextInput
                        style={styles.input}
                        placeholder="Nome Completo"
                        value={nome}
                        onChangeText={(texto) => setnome(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Sexo"
                        value={sexo}
                        onChangeText={(texto) => setsexo(texto)}
                    />

                    <View>
                        <TextInput
                            style={styles.input_nasc_dia}
                            placeholder="DIA"
                            value={dia}
                            onChangeText={(texto) => setdia(texto)}
                        />

                        <TextInput
                            style={styles.input_nasc_mes}
                            placeholder="MÊS"
                            value={mes}
                            onChangeText={(texto) => setmes(texto)}
                        />

                        <TextInput
                            style={styles.input_nasc_ano}
                            placeholder="ANO"
                            value={ano}
                            onChangeText={(texto) => setano(texto)}
                        />
                    </View>

                    <TextInput
                        style={styles.input}
                        placeholder="Celular"
                        value={celular}
                        onChangeText={(texto) => setcelular(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="CPF"
                        value={cpf}
                        onChangeText={(texto) => setcpf(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="E-mail"
                        value={email}
                        onChangeText={(texto) => setemail(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Senha"
                        value={senha}
                        onChangeText={(texto) => setsenha(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Preço"
                        value={preco}
                        onChangeText={(texto) => setpreco(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Link"
                        value={link}
                        onChangeText={(texto) => setlink(texto)}
                    />

                </View>
            </ScrollView>

            <View>
                <RectButton style={styles.buttonNext} onPress={() => navigation.navigate('tCadastroLocalC', {
                    nome: nome, celular: celular, cpf: cpf, email: email, senha: senha, preco: preco, link: link, sexo: sexo, dia: dia, ano: ano, mes: mes,
                })}>
                    <Text style={styles.buttonText}>Avançar</Text>
                </RectButton>

                <RectButton style={styles.buttonReturn} onPress={Voltar}>
                    <Text style={styles.buttonText}>Voltar</Text>
                </RectButton>
            </View>
        </ImageBackground >
    );
}
